// SPDX-License-Identifier: MIT
pragma solidity ^0.8.2;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC20/extensions/ERC20Burnable.sol";
import '@openzeppelin/contracts/access/Ownable.sol';
import "@openzeppelin/contracts/utils/math/SafeMath.sol";

contract Weed is ERC20, ERC20Burnable, Ownable {
    using SafeMath for uint256;

    ERC721 rockContract = ERC721(0x13df7973eA203868Af66fCffd86FE8cB63EDd378);

    uint256 public FIRST_CLAIM_AMOUNT = 4200;
    uint256 public DAILY_CLAIM_AMOUNT = 69;
    uint256 public MAX_UNCLAIMED_DAYS = 30;

    mapping(uint256 => bool) public firstClaim;
    mapping(uint256 => uint256) public lastClaim;

    constructor() ERC20("Weed", "WEED") {
        _mint(msg.sender, 4206969);
    }

    function claimableWeed(uint256 tokenId) public view returns (uint256 claimable) {
        if(!firstClaim[tokenId]) {
            claimable += FIRST_CLAIM_AMOUNT;
        }
        if(lastClaim[tokenId] == 0) {
            claimable += DAILY_CLAIM_AMOUNT;
        } else {
            uint256 unclaimed = block.timestamp.sub(lastClaim[tokenId]).div(86400).mul(DAILY_CLAIM_AMOUNT);
            if(unclaimed > MAX_UNCLAIMED_DAYS * DAILY_CLAIM_AMOUNT) {
                unclaimed = MAX_UNCLAIMED_DAYS * DAILY_CLAIM_AMOUNT;
            }
            claimable += unclaimed;
        }
        return claimable;
    }

    function claimWeed(uint256[] memory tokenIds) public returns (uint256 totalClaimed) {
        for(uint256 i=0; i<tokenIds.length; i++) {
            uint256 tokenId = tokenIds[i];
            require(rockContract.ownerOf(tokenId) == msg.sender, "That rock is not owned by you.");
            uint256 claimable;
            if(claimableWeed(tokenId) > 0) {
                if(!firstClaim[tokenId]) {
                    claimable += FIRST_CLAIM_AMOUNT;
                    firstClaim[tokenId] = true;
                }
                if(lastClaim[tokenId] == 0) {
                    claimable += DAILY_CLAIM_AMOUNT;
                    lastClaim[tokenId] = block.timestamp;
                } else {
                    uint256 unclaimed = block.timestamp.sub(lastClaim[tokenId]).div(86400).mul(DAILY_CLAIM_AMOUNT);
                    if(unclaimed > MAX_UNCLAIMED_DAYS * DAILY_CLAIM_AMOUNT) {
                        unclaimed = MAX_UNCLAIMED_DAYS * DAILY_CLAIM_AMOUNT;
                    }
                    if(unclaimed > 0) {
                        claimable += unclaimed;
                        lastClaim[tokenId] = block.timestamp;
                    }
                }
                totalClaimed += claimable;
            }
        }

        if(totalClaimed > 0) {
            _mint(msg.sender, totalClaimed);
        }
        return totalClaimed;
    }

    /*
    *   Money management.
    */
    function withdraw() public payable onlyOwner {
        require(payable(msg.sender).send(address(this).balance));
    }
    function forwardERC20s(IERC20 _token, uint256 _amount) public onlyOwner {
        _token.transfer(msg.sender, _amount);
    }
}
